import React from 'react'

export class Canvas extends React.Component {

	constructor(props) {
		super();
	}

	render() {

		var canvasStyle = {
			border: "1px solid black"
		}

		return (<div>
			<canvas id="drawHere" style={canvasStyle}>
				Sorry your browser does not support canvas.Update it
			</canvas>
		</div>)
	}

}

export default Canvas;
